import React, {useState} from 'react'
import axios from 'axios'
import './cadastro.css'



function Cadastro(){
    const [nome, setNome] = useState('')
    const [email, setEmail] = useState('')
    const [senha, setSenha] = useState('')
    const [cpf, setCpf] = useState('')
    const [cep, setCep] = useState('')
    const [rua, setRua] = useState('')
    const [bairro, setBairro] = useState('')
    const [cidade, setCidade] = useState('')
    const [estado, setEstado] = useState('')

    const registrar = async (e)=>{
        e.preventDefault()
        try{
            const resposta = await axios.post('https://localhost:3333/cadastrar', {
                nome,
                email,
                senha,
                cpf,
                cep,
                rua,
                bairro,
                cidade,
                estado
            })
            console.log(response.data)
    }catch(err){
        console.log(err)
    }
    }

    return(


        <div>

            <form>
                <h3>Dados de Acesso</h3>
                <label htmlFor="Nome">Nome Completo:</label>
                <input type="text" id="Nome" value={nome} required />
                <label htmlFor="email">E-mail:</label>
                <input type="email" id="email" value={email} required />

                <label htmlFor="senha">Senha de Acesso:</label>
                <input type="password" id="senha" value={senha} required />

                <h3>Dados Pessoais</h3>
                <label htmlFor="cpf">CPF:</label>
                <input type="text" id="cpf" value={cpf} required />

                <h3>Endereço</h3>

                <label htmlFor="cep">CEP:</label>
                <input type="text" id="cep" value={cep} />

                <label htmlFor="rua">Rua:</label>
                <input type="text" id="rua" value={rua} />

                <label htmlFor="numero">Número da Casa:</label>
                <input type="text" id="numero" value={numero} />

                <label htmlFor="bairro">Bairro:</label>
                <input type="text" id="bairro" value={bairro} />

                <label htmlFor="cidade">Cidade:</label>
                <input type="text" id="cidade" value={cidade} />

                <label htmlFor="estado">Estado:</label>
                <input type="text" id="estado" value={estado} />

                <div className="">
                <input type="submit" value="Cadastrar" />
                </div>
            </form>
        </div>
    )
}

export default Cadastro
